import React from 'react';

const Product = (props) => {


    return(
        <div className={"card"}>
        <div className="card-body">
          <h5 className="card-title">{props.name}</h5>
          <p className="card-text">{props.id}</p>
        </div> 
        </div>
    )
}

export default Product;
